import React from "react";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<MyProps, MyState> {
  state: MyState = {
    count: 2
  }

  render() {
    return (
      <h1>{this.props.message}: {this.state.count}</h1>
    );
  }
}

export default Home;
